import React from 'react';
import { Modal,Text, View, StyleSheet } from 'react-native';
import { TextInput } from 'react-native-gesture-handler';

const AddBoard =()=>{
    return(
        <View>
            <Text>Enter Name:</Text>
        </View>
    );
}

const styles = StyleSheet.create({
    container:{
        height:'100%',
        width:'100%',
    }
});
export default AddBoard
